import React from 'react';
import './App.css';
import img from './Assets/logo.png';

function MainPage(props){
    console.log("here");
    return(
        <div id="container">
            <header className="header">
                <img src={img} width="10%"/>
            </header>

        </div>
    );
}

export default MainPage;
